/* Function  structure for function  `fn_getId` */

/*!50003 DROP FUNCTION IF EXISTS `fn_getId` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_getId`(`NTYPE` VARCHAR(20) ) RETURNS varchar(20) CHARSET utf8
BEGIN  
  UPDATE `tb_PosNum` 
  SET maxno = (maxno+1) ,
  `VALUE` =  ( CONCAT(`TYPE` , LPAD(maxno, 4, '0') )  )
  WHERE `TYPE` = `NTYPE`;
  
	
  
  RETURN ( SELECT `VALUE` FROM tb_PosNum WHERE `TYPE` = `NTYPE` );
    
END */$$
DELIMITER ;

/* Function  structure for function  `fn_getNumber` */

/*!50003 DROP FUNCTION IF EXISTS `fn_getNumber` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_getNumber`(`NTYPE` varchar(20) ) RETURNS varchar(20) CHARSET utf8
BEGIN  
  UPDATE `tb_PosNum` 
  SET maxno = (maxno+1) ,
  `VALUE` =  ( CONCAT(`TYPE` , '-',DATE_FORMAT(NOW(),'%Y%m%d'), LPAD(maxno, 4, '0') )  )
  WHERE `TYPE` = `NTYPE`;
  
	
  
  RETURN ( SELECT `VALUE` FROM tb_PosNum WHERE `TYPE` = `NTYPE` );
    
END */$$
DELIMITER ;

/* Function  structure for function  `fn_getProductName` */

/*!50003 DROP FUNCTION IF EXISTS `fn_getProductName` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_getProductName`(`productId` VARCHAR(50)) RETURNS varchar(500) CHARSET utf8
    DETERMINISTIC
BEGIN   

  RETURN ( 
  
