/* Procedure structure for procedure `sp_addCategory` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_addCategory` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_addCategory`(	
	IN  sp_category_name VARCHAR(500),
	IN  sp_user VARCHAR(50)    
    )
BEGIN
	DECLARE rCount INT;
	DECLARE rCategory_ID VARCHAR(50);
	
	SELECT COUNT(*) INTO rCount FROM tb_Category
	WHERE 1=1
	AND category_name = TRIM(sp_category_name);
	    
	IF rCount = 0 THEN
		SELECT CONCAT('CT',LPAD(MAX(SUBSTRING(category_ID,3,4)) +1,4,'0')) INTO rCategory_ID FROM tb_Category;
		
		INSERT INTO tb_Category VALUES (rCategory_ID,sp_category_name,NOW(),sp_user); 
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_addStock` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_addStock` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_addStock`(
IN  sp_product_ID VARCHAR(50),
IN  sp_qty int
)
BEGIN
	declare stk_qty int;
    
	select qty into stk_qty from tb_ProductMaster
	where 1=1
	and product_ID = sp_product_ID;
    
    update tb_ProductMaster
	set qty = sp_qty + stk_qty
	where 1=1
	and product_ID = sp_product_ID;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_addUnitType` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_addUnitType` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_addUnitType`(
	IN  sp_unitType_name VARCHAR(500),
	IN  sp_user VARCHAR(50) 
    )
BEGIN
	DECLARE rCount INT;
	DECLARE rUnitType_ID VARCHAR(50);
	
	SELECT COUNT(*) INTO rCount FROM tb_UnitType
	WHERE 1=1
	AND unitType_name = TRIM(sp_unitType_name);
	    
	IF rCount = 0 THEN
		SELECT CONCAT('CT',LPAD(MAX(SUBSTRING(unitType_ID,3,4)) +1,4,'0')) INTO rUnitType_ID FROM tb_UnitType;
		
		INSERT INTO tb_UnitType VALUES (rUnitType_ID,sp_unitType_name,NOW(),sp_user); 
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_adjStock` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_adjStock` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_adjStock`(
IN  sp_roduct_ID VARCHAR(50),
in  sp_qty int
)
BEGIN
	update tb_ProductMaster
	set qty = sp_qty
	where 1=1
	and product_ID = sp_roduct_ID;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_cutStock` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_cutStock` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_cutStock`(
IN  sp_product_ID VARCHAR(50),
IN  sp_qty int
)
BEGIN
	declare stk_qty int;
    declare remain_qty int;
    declare remain_parent_qty int;
    declare package_ID varchar(50);
    declare product_parent_ID varchar(50);
    declare product_parent_qty int;
    declare package_child_ID varchar(50);
    declare package_child_qty int;
    declare package_product_ID varchar(50);
    declare package_product_qty int;
    declare r_parent_qty, r_count int;
 
	select qty into stk_qty from tb_ProductMaster
	where 1=1
	and product_ID = sp_product_ID;
    
    /*case not over stock*/    
    IF (sp_qty < stk_qty) THEN
			set remain_qty = stk_qty - sp_qty;
            
            update tb_ProductMaster
			set qty = remain_qty
			where 1=1
			and product_ID = sp_product_ID;
	END IF;
    
    /*case over stock and find product_ID parent*/
	IF (sp_qty > stk_qty) THEN

		/*SELECT count(*) INTO r_count
		FROM tb_Package  a
			LEFT JOIN tb_ProductMaster b ON a.product_ID = b.product_ID
			LEFT JOIN tb_Package c ON a.parent_ID = c.package_ID
			LEFT JOIN tb_ProductMaster d ON c.product_ID = d.product_ID
		where 1=1
			and a.product_ID = sp_product_ID;*/
		SELECT count(*) INTO r_count
		from tb_ProductMaster a
			left join tb_ProductMaster b ON a.parent_product_id = b.product_ID
		where 1=1
			and a.product_ID = sp_product_ID;
		
        if r_count > 0 then
			/*SELECT a.product_ID,b.qty,a.parent_qty,c.product_ID,d.qty INTO package_product_ID,package_product_qty,r_parent_qty,product_parent_ID,product_parent_qty
			FROM tb_Package  a
				LEFT JOIN tb_ProductMaster b ON a.product_ID = b.product_ID
				LEFT JOIN tb_Package c ON a.parent_ID = c.package_ID
				LEFT JOIN tb_ProductMaster d ON c.product_ID = d.product_ID
			where 1=1
				and a.product_ID = sp_product_ID;*/
			SELECT a.parent_product_id,b.qty,a.parent_sub_qty INTO product_parent_ID,product_parent_qty, r_parent_qty
			From tb_ProductMaster a
                left join tb_ProductMaster b ON a.parent_product_id = b.product_ID
			where 1=1
			and a.product_ID = sp_product_ID;
			
				 
	/*SELECT  package_product_ID,package_product_qty,r_parent_qty,product_parent_ID,product_parent_qty;*/

			if product_parent_qty <> 0 then
				/*Update qty parent qty*/
				set remain_parent_qty = product_parent_qty - 1;
				
				update tb_ProductMaster
				set qty = remain_parent_qty
				where 1=1
				and product_ID = product_parent_ID;

	/*select * from tb_ProductMaster where 1=1 and product_ID = product_parent_ID;*/

				/*Update stock qty*/
				update tb_ProductMaster
				set qty = (r_parent_qty + stk_qty) - sp_qty
				where 1=1
				and product_ID = sp_product_ID;
				
			elseif (product_parent_qty = 0 or product_parent_qty < 0) then
				set remain_qty = stk_qty - sp_qty;
				
				update tb_ProductMaster
				set qty = remain_qty
				where 1=1
				and product_ID = sp_product_ID;
			end if;  
		
        else
			set remain_qty = stk_qty - sp_qty;
				
			update tb_ProductMaster
			set qty = remain_qty
			where 1=1
			and product_ID = sp_product_ID;		
        end if;
	END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_returnStock` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_returnStock` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_returnStock`(
IN  sp_saleHeader_ID VARCHAR(50),
IN  sp_update_by VARCHAR(50)
)
BEGIN
	/*declare stk_qty int;
    
	select qty into stk_qty from tb_ProductMaster
	where 1=1
	and product_ID = sp_product_ID;*/
    	
    
	########## -- Update tb_SaleHeader ---
	update tb_SaleHeader set sale_status = 'R' ,update_date = now() ,  update_by = sp_update_by  
	WHERE saleHeader_ID= sp_saleHeader_ID;
	 
	########## -- Update tb_ProductMaster ---	
 	update tb_ProductMaster p 
 	join tb_SaleDetail d
 	on p.product_ID = d.product_ID 	
 	set p.qty = p.qty + d.qty
 	where  d.saleHeader_ID= sp_saleHeader_ID;
	
    
END */$$
DELIMITER ;

